 have a very good vision. It also has extremely sensitive ears that can detect many sounds that humans cannot hear. This animals sense of smell is highly developed and enables it to scent food at surprising distances. </span></p>\\n\"},\"subContentId\":\"a1454cec-f937-40d8-95e2-c9f422c6d9fc\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\"}},\"backgroundOpacity\":100,\"multiple\":false},{\"x\":57.972805933251,\"y\":79.178885630499,\"width\":24.222032911001,\"height\":4.1277807478368,\"dropZones\":[\"0\",\"1\",\"2\",\"3\"],\"type\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p><span style=\\\"font-size:0.625em\\\">As it flies, this animal makes a shouting sound. The returning echoes give it information about the size and shape of its prey. This system is called echolocation (locating by echoes)</span></p>\\n\"},\"subContentId\":\"f6db69d7-559f-4fcc-af48-ad66f72e2ee7\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\"}},\"backgroundOpacity\":100,\"multiple\":false},{\"x\":58.069592088999,\"y\":25.74780058651,\"width\":24.134090930161,\"height\":5.0518906829419,\"dropZones\":[\"0\",\"1\",\"2\",\"3\"],\"type\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p><span style=\\\"font-size:0.625em\\\">According to its species, this animal uses its tongue to pick up scent molecules that help it detect where the scent's source is located. They also use specialized pits located on their head that sense the heat of a hidden prey. Some can locate a potential prey by the vibrations created by the movement of the prey.</span></p>\\n\"},\"subContentId\":\"26b5c75b-e85d-46ab-8cc2-0ab8e01307af\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\"}},\"backgroundOpacity\":100,\"multiple\":false}],\"dropZones\":[{\"x\":14.95673671199,\"y\":0,\"width\":25.030902348578,\"height\":5.9089877549444,\"correctElements\":[\"6\"],\"showLabel\":false,\"background
